    "2013-03-14T19:26:49.548870",nt"name": "missing-linkages-in-californias-landscape-ds420",nt"isopen":
    false,nt"url": null,nt"notes": "The critical need for conserving landscape
    linkages first came to the forefront of conservation thinking in California in November
    2000, when a statewide interagency workshop was convened at the San Diego Zoo. Entitled
    "Missing Linkages: Restoring Connectivity to the California Landscape" the workshop
    brought together over 200 land managers, conservationists, and biologists to discuss
    and map critical and at-risk habitat linkages throughout the state. A total of 232
    linkages were identified statewide.",nt"license_title": null,nt"extras":
